import React, { useState } from 'react';
import APIClient from '../api/api';
import './LogForm.css';

function LogForm() {
    const [timestamp, setTimestamp] = useState('');
    const [userId, setUserId] = useState('');
    const [actionType, setActionType] = useState('');
    const [resource, setResource] = useState('');
    const [location, setLocation] = useState('US');
    const [device, setDevice] = useState('laptop');
    const [hourOfDay, setHourOfDay] = useState('0');
    const [numFilesAccessed, setNumFiles] = useState('');
    const [result, setResult] = useState(null);
    const [error, setError] = useState(null);

    const handleSubmit = async function (e) {
        e.preventDefault();
        setError(null);
        const log = {
            timestamp: timestamp,
            user_id: Number(userId),
            action_type: actionType,
            resource: resource,
            location: location,
            device: device,
            hour_of_day: Number(hourOfDay),
            num_files_accessed: Number(numFilesAccessed)
        };
        try {
            const res = await APIClient.post('/detect-anomaly', log);
            setResult(res.data);
        } catch (err) {
            setError('Failed to analyze log.');
            console.error(err);
        }
    };

    return React.createElement(
        <div class="log-page-wrapper">
            <div class="log-form-container">
                <h2>Analyze Single Log</h2>

                <form class="log-form" id="log-form">
                    <label for="timestamp">Timestamp:</label>
                    <input
                        id="timestamp"
                        name="timestamp"
                        type="datetime-local"
                        required
                    />

                    <label for="user_id">User ID:</label>
                    <input
                        id="user_id"
                        name="user_id"
                        type="number"
                        required
                    />

                    <label for="action_type">Action Type:</label>
                    <input
                        id="action_type"
                        name="action_type"
                        type="text"
                        required
                    />

                    <label for="resource">Resource:</label>
                    <input
                        id="resource"
                        name="resource"
                        type="text"
                        required
                    />

                    <label for="location">Location:</label>
                    <select id="location" name="location">
                        <option value="US">US</option>
                        <option value="IN">IN</option>
                        <option value="UK">UK</option>
                    </select>

                    <label for="device">Device:</label>
                    <select id="device" name="device">
                        <option value="laptop">laptop</option>
                        <option value="mobile">mobile</option>
                        <option value="vpn">vpn</option>
                    </select>

                    <label for="hour_of_day">Hour of Day:</label>
                    <input
                        id="hour_of_day"
                        name="hour_of_day"
                        type="number"
                        min="0"
                        max="23"
                        required
                    />

                    <label for="num_files_accessed">Files Accessed:</label>
                    <input
                        id="num_files_accessed"
                        name="num_files_accessed"
                        type="number"
                        required
                    />

                    <button type="submit">Check Anomaly</button>
                </form>

                <p class="error" id="form-error" style="display:none;"></p>

                <div class="result" id="form-result" style="display:none;">
                    <p id="result-score">Score: <span></span></p>
                    <span class="badge" id="result-badge">Normal</span>
                    <pre id="result-json">{ }</pre>
                </div>
            </div>
        </div>
    );
}

export default LogForm;
